import { SharedCard } from './SharedCard';
import Illustration_18 from '../../../assets/images/js/Illustration_18.js';

export const CardRecommendation = props => {
  const image = <Illustration_18 />;
  const description = 'Get a recommendation after at least 12 sessions';
  const navLink = 'List';

  return (
    <>
      <SharedCard
        image={image}
        title={title}
        description={description}
        navLink={navLink}
        nextButton={nextButton}
      />
    </>
  );
};
